import React from "react";

class UserSignUpPage extends React.Component{

    state = {//Comes from React.components
        username: null,
        displayname: null,
        password: null,
        passwordRepeat: null
    };
  
    onChangeUsername = event => {
        this.setState({
            username: event.target.value
        });
    };

    onChangeDisplayName = event => {
        this.setState({
            displayname: event.target.value
        });
    };
    
    onChangePassword = event => {
        this.setState({
            password: event.target.value
        });
    };

    onChangePasswordRepeat = event => {
        this.setState({
            passwordRepeat: event.target.value
        });
    };

    render(){
        return(
            <form>
                <h1>Sign Up Page</h1>
                <div>
                    <label>Username</label>
                    <input onChange={this.onChangeUsername}/>
                </div>
                <div>
                    <label>Display Name</label>
                    <input onChange={this.onChangeDisplayName}/>
                </div>
                <div>
                    <label>Password</label>
                    <input type="password" onChange={this.onChangePassword}/>
                </div>
                <div>
                    <label>Password Repeat</label>
                    <input type="password" onChange={this.onChangePasswordRepeat}/>
                </div>
                <button class="signUpButton">Sign Up</button>
            </form>
        );
    }
}

export default UserSignUpPage;
